<script>
import {mapActions, mapMutations} from "vuex";
import i18n from "@/i18n";
import CheckService from "@/shared/services/checkService";
import crud_and_listService from "@/shared/services/crud_and_list.service";
import crudAndListsService from "@/shared/services/crud_and_list.service";

export default {
  data() {
    return {
      languages: [
        {
          flag: require("../auth/images/mainPageImages/flags/uzbekistan.png"),
          language: "uz",
          title: "O'Z",
        },
        {
          flag: require("../auth/images/mainPageImages/flags/uzbkril.png"),
          language: "uzCyrillic",
          title: "ЎЗ",

        },
        {
          flag: require("../auth/images/mainPageImages/flags/russia.png"),
          language: "ru",
          title: "РУ",
        },
        // {
        //   flag: require("../auth/images/mainPageImages/flags/united-states-of-america.png"),
        //   language: "en",
        //   title: "En",
        // }
      ],
      lan: this.$i18n.locale,
      text: null,
      flag: null,
      loading: false,
      searchingModal: false,
      currentLocale: {},
      isTelefonActive: true,
      isJshshirActive: false,
      telefonInput: "",
      jshshirInput: "",
      fish: '',
      appealCount: '',
      appealDate: '',
      getUserDatas:{},
      id: null,
    }
  },
  computed: {
    getCurrentDate() {
      const now = new Date();
      // console.log(new Date())
      // console.log(now)
      // const options = { year: 'numeric', month: 'long', day: 'numeric' };
      // return now.toLocaleDateString(undefined, options);
      let day = now.getDate()
      let month = now.getMonth()
      let year = now.getFullYear()
      return day + ' ' + this.monthName(month) + ' ' + year
    },
    getPharmacyRefPrice(){
      return this.getUserDatas.medications.reduce((x, y) => x + y.referentPrice, 0)
    },
    getPharmacyAllPrice(){
      return this.getUserDatas.medications.reduce((x, y) => x + y.paymentPrice, 0)
    },
    getPharmacyMonthDate() {
      let month = (this.getUserDatas.createJson.substring(4, 5)) > 10 ? (Number(this.getUserDatas.createJson.substring(3, 5)))-1 : (Number(this.getUserDatas.createJson.substring(4, 5)))-1
      return  this.monthLatName(month)
    },


    isSendButtonDisabled() {
      if (this.isTelefonActive) {
        return !this.telefonInput.trim();
      } else if (this.isJshshirActive) {
        return !this.jshshirInput.trim();
      }
      return true; // Disable the button if neither input is active
    },
  },
  methods: {
    ...mapActions(['setCount']),
    ...mapMutations({
      setLocale: "SET_LOCALE"
    }),
    monthLatName(number) {
      return number === 0 ? 'yanvar' :
          number === 1 ? 'fevral' :
              number === 2 ? 'mart' :
                  number === 3 ? 'aprel' :
                      number === 4 ? 'may' :
                          number === 5 ? 'iyun' :
                              number === 6 ? 'iyul' :
                                  number === 7 ? 'avgust' :
                                      number === 8 ? 'sentabr' :
                                          number === 9 ? 'oktabr' :
                                              number === 10 ? 'noyabr' :
                                                  number === 11 ? 'dekabr' : 'no date'
    },

    monthName(num) {
      return num === 0 ? this.$t('month.january') :
          num === 1 ? this.$t('month.february') :
              num === 2 ? this.$t('month.march') :
                  num === 3 ? this.$t('month.april') :
                      num === 4 ? this.$t('month.may') :
                          num === 5 ? this.$t('month.june') :
                              num === 6 ? this.$t('month.july') :
                                  num === 7 ? this.$t('month.august') :
                                      num === 8 ? this.$t('month.september') :
                                          num === 9 ? this.$t('month.october') :
                                              num === 10 ? this.$t('month.november') :
                                                  num === 11 ? this.$t('month.december') : 'no date'
    },
    async changeLocale(localeCode) {
      if (this.$i18n.locale !== localeCode) {
        window.location.reload();
        await this.setLocale(localeCode);
        this.currentLocale = this.languages.find(locale => locale.language === localeCode)
      }
    },
    showInput(type) {
      this.isTelefonActive = type === 'phoneNumber';
      this.isJshshirActive = type === 'pinfl';
    },
    sendRequest() {
      this.loading = true;
      let check = {
        phoneNumber:this.telefonInput.slice(4),
        pinfl:this.jshshirInput,
        fish: this.fish,
        appealCount: this.appealCount,
        appealDate: this.appealDate
      }
      this.searchLoader = true;
      return CheckService.pharmCheckOutside(check)
          .then((result)=>{
            this.getUserDatas = result.data;
            this.phoneNumber = '';
            this.pinfl = '';
            this.fish = '';
            this.appealCount = '';
            this.appealDate = '';
            this.searchLoader = false;
            this.loading = false;
            // console.log(result.data)
          })
          .catch((err) => {
              // this.catchErr(err);
          })
          .finally(() => {
            this.searchLoader = false;
            this.searchingModal = false;
            this.loading = false;
          });
    },
    getConfirmPharmacyList(){
      let id = this.$route.params.id;
      crud_and_listService.getConfirmPharmacy(id)
          .then((res)=>{
            this.getUserDatas = res.data;
            // console.log(res)
          })
          .catch((err)=>{
            console.log(err);
          })
    },
    downloadFile(id) {
      crud_and_listService
          .getPharmacyFile(id)
          .then((res) => {
            const url = window.URL.createObjectURL(new Blob([res.data]));
            const fileLink = document.createElement("a");
            fileLink.href = url;
            const filename = `file.docx`;
            fileLink.setAttribute('download', filename);
            document.body.appendChild(fileLink);
            fileLink.click();
            fileLink.remove();
          })
          .catch(e => {
            console.log(e)
          })
    },
  },
  mounted() {
    this.getConfirmPharmacyList();
    this.value = this.languages.find((x) => x.language === i18n.locale);
    this.text = this.value.title;
    this.flag = this.value.flag;
    // console.log(this.$route.params.id)
  },
}
</script>
